package com.sun.jbi.cam.manager.framework.plugins;

/**
 *
 * @author ylee
 */
public class DisplayMappings {
    
    private String type;
    private String url;
    
    /** Creates a new instance of DisplayMappings */
    public DisplayMappings(String type, String url) {
        this.type = type;
        this.url = url;
    }
    
    public String getType() {
        return type;
    }
    
    public void setType(String type) {
        this.type = type;
    }
    
    public String getUrl() {
        return url;
    }
    
    public void setUrl(String url) {
        this.url = url;
    }    
    
}
